import React, { Component } from 'react';
import BrokerData from "../components/Brokers/BrokerData";
import {Grid} from "@material-ui/core";
import Button from '@material-ui/core/Button';
import Popup from "../components/Popup";
import './styles.css';

class BrokersContainer extends Component {

    constructor(props){
        super(props);
        this.state = { showPopup: false };
    }

    togglePopup() {
        this.setState({
            showPopup: !this.state.showPopup
        });
    }

    render() {
        return (
            <Grid>
                <h4>Brokers:</h4>
                


                <div>
                    <h1> Simple Popup Example In React Application </h1>
                    <button onClick={this.togglePopup.bind(this)}> Click To Launch Popup</button>

                    {this.state.showPopup ?
                        <Popup
                            text='Click "Close Button" to hide popup'
                            closePopup={this.togglePopup.bind(this)}
                        />
                        : null
                    }
                </div>


                <div className='cont-broker-data'>
                    <BrokerData></BrokerData>
                </div>
            </Grid>
        )
    }
}

export default BrokersContainer;
